import "./App.css";
import { Routes, Route } from "react-router-dom";
//import Home from "./Pages/Home.js";

import About from "./Pages/About";

function App() {
  return (
    <>
      <Routes>
        <Route path="/" element={<About />}></Route>
      </Routes>
    </>
  );
}

export default App;
